import { MAT_DIALOG_DATA } from '@angular/material/dialog';
import * as i0 from "@angular/core";
import * as i1 from "src/app/service/cheetaOkr.service";
import * as i2 from "@angular/material/dialog";
import * as i3 from "src/app/service/notification/notifications.service";
export class DeleteComponent {
    constructor(cheetaOkrService, dialogRef, notification, data) {
        this.cheetaOkrService = cheetaOkrService;
        this.dialogRef = dialogRef;
        this.notification = notification;
        this.data = data;
        this.okrInfo = {};
    }
    ngOnInit() {
        this.okrInfo = this.data.ticketInfo;
        this.takeSub = this.cheetaOkrService.getOkrUpdateListener()
            .subscribe(async (data) => {
            await this.onDelete();
        });
    }
    async onDelete() {
        console.log(this.data);
        try {
            await this.cheetaOkrService.deleteOkr(this.data.id);
            this.notification.openDialog('Deleted Successfully');
            this.dialogRef.close();
        }
        catch (err) {
            this.notification.openWarningDialog("Something went wrong");
        }
    }
    ngOnDestroy() {
        this.takeSub.unsubscribe();
    }
}
